import Sidebar from "../../sidebar/Sidebar";
import "./setting.css";

function Setting() {
  return (
    <div className="settings">
      <div className="settingWrapper">
       <div className="settingTitle">
           </div>
      </div>
      <Sidebar />
    </div>
  );
}

export default Setting;
